-- Dumping structure for procedure pgenx-cmsqb.sp_Actualizar_CMS

DELIMITER //
DROP PROCEDURE IF EXISTS sp_Actualizar_CMS//
CREATE PROCEDURE `sp_Actualizar_CMS`(
	IN `in_campoActualizar` VARCHAR(50),
	IN `in_valorActualizar` VARCHAR(1000),
	IN `in_PO_Number` VARCHAR(150)
)
BEGIN
	SET @MaxId = NULL;
	
	SELECT MIN(Id) INTO @MaxId
	FROM `Data` l
	WHERE PO_Number=in_PO_Number;

	SET @Query = CONCAT('UPDATE  `Data`
			SET ', in_campoActualizar, '=''', in_valorActualizar, '''
			WHERE Id=',@MaxId);
	
	-- SELECT @Query;
	PREPARE smpt FROM @Query;
	-- ejecutamos el Statement
	EXECUTE smpt;
	-- liberamos la memoria
	DEALLOCATE PREPARE smpt;
END//
DELIMITER ;

